Create PROCEDURE [dbo].[Add_properShipNames] as 
BEGIN
Create Table #TempShipping
(
Code nvarchar(100),
[Name] nvarchar(1000),
IATA nvarchar(10),
UNNumber nvarchar(10)
)


Declare @SourceTable nvarchar(50)
Declare @SourceEntityID int
Declare @SourceModelID int
Declare @script nvarchar(1000)
SELECT @SourceModelID = ID from [mdm].[tblModel] where [Name] = 'AX' 
SELECT @SourceEntityID = ID from [mdm].[tblEntity] where Model_ID = @SourceModelID and [Name] = 'UNNumber'
SELECT @SourceTable = EntityTable from [mdm].[tblEntity] where ID = @SourceEntityID
Declare @SQL nvarchar(max)  = 'Insert into [stg].[ProperShippingName_Leaf] (BatchTag,ImportType, Code, Name, UNNumber, IATACLASSCODE) 
							  Select ''InsertShippingValues'',1,tp.Code,tp.[Name],unn.Code,tp.IATA from mdm.'+@SourceTable+' unn inner join #TempShipping tp on tp.UNNumber = unn.Name'  
EXEC sp_executesql @sql
exec [stg].[udp_ProperShippingName_Leaf] @VersionName=N'VERSION_1',@LogFlag=1, @BatchTag = 'InsertShippingValues'

--Shipping Name Extension


exec [stg].[udp_ProperShippingNameExtension_Leaf] @VersionName=N'VERSION_1',@LogFlag=1, @BatchTag = 'InsertExtension'

END
